The code you provided does not seem to be returning a type error for 'students'. However, there is a declaration of the 'students' variable at the beginning of the code that is not initialized.
```swift
public static LinkedList<Student> students; // List of all the students
```
To fix this error, you should initialize the 'students' variable to an empty linked list. You can do this in the main method after declaring the variable:
```typescript
public static void main(String[] args) {
    // Initialize the students list
    students = new LinkedList<Student>();

    // Rest of the code
    ...
}
```
This will initialize the 'students' variable to an empty linked list and resolve the error.
